import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Home.css';
import Products from './Products';

const Home = ({ cart, setCart, handleAddToCart }) => {
  const [recommendations, setRecommendations] = useState([]);
  const [topRated, setTopRated] = useState([]);
  const [relatedProducts, setRelatedProducts] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [activeTab, setActiveTab] = useState('recommendations'); // default tab

  const navigate = useNavigate();
  const userId = localStorage.getItem("user_id");

  const fetchRelatedProducts = async () => {
    try {
      const response = await fetch(`http://localhost:5000/recommend-by-brand?user_id=${userId}`);
      const data = await response.json();
      if (response.ok) {
        const relatedItems = data?.slice(0, 15);
        setRelatedProducts(relatedItems);
      } else {
        console.error("Error fetching related products:", data.error);
      }
    } catch (error) {
      console.error("Error fetching related products:", error);
    }
  };

  const fetchCollaborativeRecommendations = async () => {
    if (!userId) return;
    setLoading(true);
    setError('');
    try {
      const { data } = await axios.get(`http://localhost:5000/recommendations?user_id=${userId}`);
      const filteredRecommendations = data.filter(rec => rec.Rating > 0.0);
      setRecommendations(filteredRecommendations);
    } catch (error) {
      setError('Failed to fetch recommendations. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const fetchTopRatedProducts = async () => {
    setLoading(true);
    setError('');
    try {
      const { data } = await axios.get('http://localhost:5000/rating-recommendation');
      setTopRated(data);
    } catch (error) {
      setError('Failed to fetch top-rated products. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const fetchCart = async () => {
    try {
      const response = await fetch(`http://localhost:5000/get_cart?user_id=${userId}`);
      const data = await response.json();
      if (response.ok) {
        setCart(data.cart);
      } else {
        console.error("Error fetching cart:", data.error);
      }
    } catch (error) {
      console.error("Error fetching cart:", error);
    }
  };

  useEffect(() => {
    fetchCollaborativeRecommendations();
    fetchTopRatedProducts();
    fetchRelatedProducts();
    fetchCart();
  }, []);

  const renderProducts = () => {
    if (activeTab === 'related') {
      return <Products items={relatedProducts} handleAddToCart={handleAddToCart} fetchCart={fetchCart} handleClick={() => {}} />;
    } else if (activeTab === 'topRated') {
      return <Products items={topRated} handleAddToCart={handleAddToCart} fetchCart={fetchCart} handleClick={() => {}} />;
    } else {
      return <Products items={recommendations} handleAddToCart={handleAddToCart} fetchCart={fetchCart} handleClick={() => {}} />;
    }
  };

  return (
    <div className="home-container">
      <div className="tab-buttons flex gap-4 justify-center my-4">
        <button className={`px-4 py-2 rounded ${activeTab === 'recommendations' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`} onClick={() => setActiveTab('recommendations')}>Recommended</button>
        <button className={`px-4 py-2 rounded ${activeTab === 'related' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`} onClick={() => setActiveTab('related')}>Related</button>
        <button className={`px-4 py-2 rounded ${activeTab === 'topRated' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`} onClick={() => setActiveTab('topRated')}>Top Rated</button>
      </div>

      {loading && <p className="text-center">Loading...</p>}
      {error && <p className="text-red-500 text-center">{error}</p>}
      {!loading && !error && renderProducts()}

      <hr className="section-divider" />
      <footer className="footer text-center py-4">
        <p>&copy; 2025 Rahilkhan Recommendation System. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
